import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import About from './About';

import Contact from './Contact';

const App = () => {

  return (
    <>
      <Router>
        <Routes >

          {(() => {
            <Route path="/about" element={About}></Route>
          })}

        </Routes>
      </Router>
      {/* <About/>
        <Contact/>  */}
    </>
  )
}

export default App;
